import React from 'react';
import TwitterLogo from '../Assets/twitter.svg';
import GitHubLogo from '../Assets/github.svg';
import InstagramLogo from '../Assets/instagram.svg';

class Contact extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="w-100 p-5" style={{height: 'fit-content', backgroundColor: '#222831', color: '#EEEEEE'}}>
         <h1>Contact</h1>
         <p>Let's run minds and work together ðŸ˜€</p>
         <form class="container d-flex flex-column text-start rounded-4 p-3 w-sm-70" style={{border:'2px solid #00ADB5', maxWidth: 500}}>
            <label for="email" className="d-flex flex-column my-2">Email
            <input id="email" type="email" placeHolder="Enter your email" className="rounded-3" style={{border:'2px solid #03045E', height:50}}/>
            </label> 
            <label for="name" className="d-flex flex-column my-2">Name
            <input id="name" type="text" placeHolder="Enter your name" className="rounded-3" style={{border:'2px solid #03045E', height:50, backgroundColor:'#EEEEEE'}}/>
            </label>
            <label for="message" className="d-flex flex-column my-2">Got some info for me?
            <input id="name" type="text" placeHolder="Message" className="rounded-3" style={{height: 100, border: '2px solid #03045E', backgroundColor:'#EEEEEE'}} />
            </label>
            <button type="submit" className="btn block my-2" style={{backgroundColor: '#00ADB5', color:'#EEEEEE'}}>Message Me</button>
         </form>
         <div className="w-100 d-flex flex-row text-center">
            <img src={InstagramLogo} alt="Instagram link"/>
            <img src={GitHubLogo} alt="Github link"/>
            <img src={TwitterLogo} alt="Twitter link" />
         </div>
      </div>
    );
  }
}

export { Contact }
